import styled from 'styled-components/native';

export const Title = styled.Text`
    position: absolute;
    width: 123px;
    height: 24px;
    left: 30px;
    top: 105px;
    font-family: Poppins;
    font-style: normal;
    font-weight: 600;
    font-size: 16px;
    line-height: 24px;
    color: #1D1617;
`;

export const Container = styled.View`
    background: blue;
`;
